CREATE TABLE pessoa_salario_consolidado (
                                            id BIGSERIAL PRIMARY KEY,
                                            pessoa_id BIGINT NOT NULL,
                                            nome_pessoa VARCHAR(255) NOT NULL,
                                            nome_cargo VARCHAR(255) NOT NULL,
                                            salario NUMERIC(19, 2) NOT NULL
);


    -- 🔥 Ajuste da sequência após inserções manuais
SELECT setval('pessoa_salario_consolidado_id_seq', (SELECT MAX(id) FROM pessoa_salario_consolidado));
